    "content": "\rD4_DU_prevalence_MS_in_pregnancy_cohortcontains the aggregated prevalence (numerators and denominators) needed to compute prevalence of MS in the pregnancy cohort, to feed Template 4 and 5\nD4_DU_individual_prevalence_of_use_MSmeds_in_MSpregnancy_trimestersthis dataset measures in each MS pregnancy whether the woman used or didn't use each of the MS medications in the trimesters before or during pregnancy (to ultimately feed Template 3)\nD4_DU_prevalence_of_exclusive_use_MSmeds_in_MSpregnancy_trimestersthis is the aggregation of the individual-level dataset D4_DU_individual_prevalence_of_use_MSmeds_in_MSpregnancy_trimesters, to feed Template 3. It contains counts of persons using medicines exclusively in some periods before and during pregnancy\nD4_DU_prevalence_of_use_MSdrugs_in_MS_cohortcontains the aggregated numerators needed to compute prevalence of use of MS medications in the MS cohort, to feed Template 6 and 7.\nD4_DU_prevalence_of_use_MSdrugs_in_MSpregnancy_cohort\r ",
