    "content": "\rD5_DU_for_Template_3numbers to be included in Template 3: Pattern of MS DMT medication use (for each drug individually and for any MS drug use) during pregnancy in women from the MS Pregnancy cohort\nD5_DU_for_Template_4numbers to be included in Template 4: Prevalence of MS over time per 1,000 pregnancies from women aged 15-49 years old\nD5_DU_for_Template_5numbers to be included in Template 5: Prevalence of MS stratified by age at LMP and calendar period per 1,000 pregnancies\nD5_DU_for_Template_6numbers to be included in Template 6: Prevalence of MS medication in women of childbearing age with MS at cohort entry over time\nD5_DU_for_Template_7numbers to be included in Template 7: Prevalence of MS medication in women of childbearing age with MS at cohort entry by study period and age group\nD5_DU_for_Templats_8_11\r ",
