    "content": "Documentation for the DP3 project _index.enD4_DU_prevalence_MS_in_pregnancy_cohortcontains the aggregated prevalence (numerators and denominators) needed to compute prevalence of MS in the pregnancy cohort, to feed Template 4 and 5 D4_DU_individual_prevalence_of_use_MSmeds_in_MSpregnancy_trimestersthis dataset measures in each MS pregnancy whether the woman used or didn't use each of the MS medications in the trimesters before or during pregnancy (to ultimately feed Template 3) D4_DU_prevalence_of_exclusive_use_MSmeds_in_MSpregnancy_trimestersthis is the aggregation of the individual-level dataset D4_DU_individual_prevalence_of_use_MSmeds_in_MSpregnancy_trimesters, to feed Template 3. It contains counts of persons using medicines exclusively in some periods before and during pregnancy\n_index.enD5_DU_for_Template_3numbers to be included in Template 3: Pattern of MS DMT medication use (for each drug individually and for any MS drug use) during pregnancy in women from the MS Pregnancy cohort D5_DU_for_Template_4numbers to be included in Template 4: Prevalence of MS over time per 1,000 pregnancies from women aged 15-49 years old D5_DU_for_Template_5numbers to be included in Template 5: Prevalence of MS stratified by age at LMP and calendar period per 1,000 pregnancies\n_index.en\rD3_personscontains the cleaned version of PERSONS, where birth date and death date are reconstituted as dates D3_output_spells_categorycontains the spells exited from CreateSpells, i.e., all the continuous spells of observation period of each person, stratified per op_meaning. op_meaning is by default the same for all observation periods, and is set in 05_subpopulations_restricting_meanings for those data sources where the analysis is conducted on subpopulations having different sets of data banks conceptsetdataset\ritemsetdataset\rpromptsetdataset\rD3_clean_spells\rD3_selection_criteria_from_PERSONS_to_study_population\r_index.en\rD4_study_population_SAP1\rFlowchart_exclusion_criteriacounts of how many indivuals from PERSONS are excluded in the study population Flowchart_exclusion_criteria_maskedcounts of how many indivuals from PERSONS are excluded in the study population _index.enD3_study_population_SAP1contains the baseline characteristics of the study population D3_main_components\rD3_outcomes_cleaned\rD3_drug_proxies_cleaned\rD5_meaning_occurencescounts for MS and SLE of each original_meaning D5_meaning_occurences_maskedcounts for MS and SLE of each original_meaning D3_components_MS_SAP1contains the components of MS and their combinations. Components and combination are expressed as dates to allow for computation of prevalence. This D3 is based on Table 1 of the SAP1 D3_components_multiple_lookback_MS\rD3_algorithms_MScontains the dates when each person in the study population becomes positive for MS according to any of the 5 algorithms\n_index.en\rD5_N_women_and_ranges_MSvalues needed for Template 1 of the SAP: for each component, N of women, median time in study population and IQR (Years), and median and IQR age at study entry date D5_N_women_and_ranges_MS_maskedvalues needed for Template 1 of the SAP: for each component, N of women, median time in study population and IQR (Years), and median and IQR age at study entry date D5_prevalence_period\rD5_prevalence_period_masked\rD5_prevalence_persontime\rD5_prevalence_persontime_masked\rD5_prevalence_average_point\rD5_prevalence_average_point_masked\rD5_prevalence_aggregated_multiple_lookback\rD5_prevalence_aggregated_multiple_lookback_masked\rD5_prevalence_aggregated_all\rD5_prevalence_aggregated_all_masked\r_index.en\rD3_SAP1_MS_COHORTcontains the cohort of study population who have MS based on the algorithm chosen at the end of SAP1 D3_DU_selection_criteria_from_SAP1_MS_cohort_to_DU_MS_cohortcontains the exclusion criteria to go from D3_study_population_SAP1 to the study population of the DP3 DU, as decsribed in subsection 4.3.1 of MS DP3_SAP_DU_MS_V2.2 D3_DU_selection_criteria_from_pregnancies_to_DU_PREGNANCY_COHORTcontains the exclusion criteria to go from D3_final_pregnancy to the pregnancies of D3_DU_PREGNANCY-COHORT, as described in subsection 4.1 of DP3_SAP_DU_MS_V2.2 _index.enD4_DU_MS_COHORTcontains the subset of the study population who have MS based on the algorithm chosen at the end of SAP1 and that comply with the exclusion criteria of the DU study (stored in D3_DU_selection_criteria_from_SAP1_MS_cohort_to_DU_MS_cohort and in section 4.3.1 of the DU SAP) D5_DU_flowchart_exclusion_criteria_from_SAP1_MS_cohort_to_DU_MS_cohort\rD4_DU_PREGNANCY_COHORTcontains the cohort of pregnancies included in the study, including both those with MS and those without MS, as described in section 4.1 of DP3_SAP_DU_MS_V2.2. It is obtained from D3_DU_selection_criteria_from_pregnancies_to_DU_PREGNANCY-COHORT by excluding all pregnancies with at least one of the exclusion criteria == 1\n_index.en\rD3_DU_PREGNANCY_COHORT_variablescontains the cohort of pregnancies included in the study, including both those with MS and those without MS, as decsribed in section 4.1 of DP3_SAP_DU_MS_V2.2 _index.en\rD5_DU_for_Template_1numbers to be included in Template 1: Description of the time period between 2 pregnancies in the pregnancy cohort and in the MS-pregnancy cohort (ref: DP3_SAP_DU_MS_V2.2) D5_DU_for_Template_2numbers to be included in Template 2: Description of the time period between MS diagnosis (MS diagnosis date=the date on which the algorithm becomes positive) and pregnancy in D3_DU_PREGNANCY-COHORT_variables if after or during MS diagnosis _index.en\rD4_candidate_matches_MS_non_pregnantThis applies some of the steps in the appendix: selects all the periods when women with MS are outside of the DU pregnant persontime D4_DU_matched_MS_PREGNANCY_COHORT_to_MS_COHORTcontains D3_DU_MS-PREGNANCY-COHORT plus persons from D3_DU_MS-COHORT, the latter matched 4-1 to the former, and being non-pregnant during the pregnancy period of the matched pregnancy D5_DU_matching_diagnosticNA  ",
